module.exports = "<app-spinner [spinner]=\"loading\"></app-spinner>\r\n<div *ngIf=\"!loading.loading\">\r\n  <div>\r\n    <h5>Основная информация:</h5>\r\n    <div class=\"mb-2\">\r\n      <span *ngIf=\"user.moder.isModer\" class=\"badge badge-info\">Модератор</span>\r\n      <span *ngIf=\"user.addr === cs.ownerAddr\" class=\"badge badge-warning\">Админ</span>\r\n    </div>\r\n    <div>\r\n      <ul class=\"list-style-none\">\r\n        <li><i class=\"mr-2\">Ник:</i> <b [innerText]=\"user.name\"></b></li>\r\n        <li><i class=\"mr-2\">Адрес:</i> <b [innerText]=\"user.addr\"></b></li>\r\n        <li><i class=\"mr-2\">Дата регистрации:</i> <b [innerText]=\"user.regTime | date: 'dd.MM.yyyy HH:mm'\"></b></li>\r\n        <li><i class=\"mr-2\">Кол-во приглашенных:</i> <b [innerText]=\"user.refCount\"></b></li>\r\n        <li><i class=\"mr-2\">Реферальный процент:</i>\r\n          <b>{{user.superInvestorPercent ? user.superInvestorPercent : \"10\"}}%</b></li>\r\n        <li><i class=\"mr-2\">Заработано:</i> <b [innerText]=\"user.earn + ' trx'\"></b></li>\r\n      </ul>\r\n    </div>\r\n  </div>\r\n  <div *ngIf=\"user.moder.isModer\">\r\n    <hr>\r\n    <h5>Основная статистика:</h5>\r\n    <div>\r\n      <table class=\"table table-sm table-bordered table-dark mb-0\">\r\n        <thead>\r\n        <tr>\r\n          <th>ID</th>\r\n          <th>Заблокированно пользователей</th>\r\n          <th>Удаленно сообщений</th>\r\n          <th>Модератор?</th>\r\n          <th>Уволен?</th>\r\n        </tr>\r\n        </thead>\r\n        <tbody>\r\n        <tr>\r\n          <td>\r\n            <div title=\"{{user.moder.id}}\" [innerText]=\"user.moder.id\"></div>\r\n          </td>\r\n          <td>\r\n            <div [innerText]=\"user.moder.banUserCount\">\r\n            </div>\r\n          </td>\r\n          <td>\r\n            <div [innerText]=\"user.moder.deletedLength\">\r\n            </div>\r\n          </td>\r\n          <td [innerText]=\"user.moder.isModer ? 'Да' : 'Нет'\"></td>\r\n          <td [innerText]=\"user.moder.hasAccess ? 'Нет' : 'Да'\"></td>\r\n        </tr>\r\n        </tbody>\r\n      </table>\r\n    </div>\r\n    <hr>\r\n    <div>\r\n      <h5>Список заблокированных пользователей: </h5>\r\n      <div class=\"form-check mb-2\">\r\n        <input class=\"form-check-input\" type=\"checkbox\" value=\"\" id=\"expired-checkbox\">\r\n        <label class=\"form-check-label\" for=\"expired-checkbox\">\r\n          Учитывать пользователей, у которых истекло время бана\r\n        </label>\r\n      </div>\r\n      <table class=\"table table-sm table-bordered table-dark mb-0\">\r\n        <thead>\r\n        <tr>\r\n          <th>Ник</th>\r\n          <th>Истекает</th>\r\n          <th>Причина</th>\r\n          <th>Сообщение заблокированного</th>\r\n          <th>Действия</th>\r\n        </tr>\r\n        </thead>\r\n        <tbody>\r\n        <tr *ngFor=\"let bannedUser of user.moder.bannedUserList\">\r\n          <td [innerText]=\"bannedUser.userInfo.name\"></td>\r\n          <td [innerText]=\"bannedUser.expired | date:'dd/MM/yyyy h:mm:ss'\"></td>\r\n          <td [innerText]=\"bannedUser.reason\"></td>\r\n          <td>\r\n            <app-icons [type]=\"'load-message'\" [data]=\"{messageId: bannedUser.messageId, typeId: bannedUser.typeId}\"></app-icons>\r\n          </td>\r\n          <td>\r\n            <app-icons [type]=\"'show-more-user'\" [data]=\"bannedUser.userInfo.addr\"></app-icons>\r\n          </td>\r\n        </tr>\r\n        </tbody>\r\n      </table>\r\n      <div *ngIf=\"!user.moder.bannedUserList.length\" class=\"h4 text-muted text-center p-4 border\">\r\n        Нет данных\r\n      </div>\r\n    </div>\r\n    <hr>\r\n    <div>\r\n      <h5>Список удаленных сообщений:</h5>\r\n      <table class=\"table table-sm table-bordered table-dark mb-0\">\r\n        <thead>\r\n        <tr>\r\n          <th>Сообщение</th>\r\n          <th>Дата</th>\r\n        </tr>\r\n        </thead>\r\n        <tbody>\r\n        <tr *ngFor=\"let msg of user.deletedMessages\">\r\n          <td [innerText]=\"msg.message\"></td>\r\n          <td [innerText]=\"msg.time | date: 'dd/MM/yyyy h:mm:ss'\"></td>\r\n        </tr>\r\n        </tbody>\r\n      </table>\r\n      <div *ngIf=\"!user.deletedMessages.length\" class=\"h4 text-muted text-center p-4 border\">\r\n        Нет данных\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <hr>\r\n  <div>\r\n    <h5>История поощрений:</h5>\r\n    <table class=\"table table-sm table-bordered table-dark mb-0\">\r\n      <thead>\r\n      <tr>\r\n        <th>Кто</th>\r\n        <th>Время</th>\r\n        <th>Пожелание</th>\r\n        <th>Количество монет</th>\r\n      </tr>\r\n      </thead>\r\n      <tbody>\r\n      <tr *ngFor=\"let thank of user.thankList\">\r\n        <td>\r\n          <div class=\"text-ellipsis\" [innerText]=\"thank.who\" title=\"{{thank.who}}\"></div>\r\n        </td>\r\n        <td [innerText]=\"thank.time | date: 'dd/MM/yyyy h:mm:ss'\"></td>\r\n        <td [innerText]=\"thank.description\" title=\"{{thank.description}}\"></td>\r\n        <td [innerText]=\"thank.count\"></td>\r\n      </tr>\r\n      </tbody>\r\n    </table>\r\n    <div *ngIf=\"!user.thankList.length\" class=\"h4 text-muted text-center p-4 border\">\r\n      Нет данных\r\n    </div>\r\n  </div>\r\n  <hr>\r\n  <div>\r\n    <h5>История жалоб:</h5>\r\n    <table class=\"table table-sm table-bordered table-dark mb-0\">\r\n      <thead>\r\n      <tr>\r\n        <th>Кто</th>\r\n        <th>Время</th>\r\n        <th>Подробное описание жалобы</th>\r\n      </tr>\r\n      </thead>\r\n      <tbody>\r\n      <tr *ngFor=\"let claim of user.claimList\">\r\n        <td>\r\n          <div class=\"text-ellipsis\" [innerText]=\"claim.who\" title=\"{{claim.who}}\"></div>\r\n        </td>\r\n        <td>\r\n          <div class=\"text-ellipsis\" [innerText]=\"claim.time | date: 'dd/MM/yyyy h:mm:ss'\"></div>\r\n        </td>\r\n        <td>\r\n          <div class=\"text-ellipsis\" [innerText]=\"claim.description\" title=\"{{claim.description}}\"></div>\r\n        </td>\r\n      </tr>\r\n      </tbody>\r\n    </table>\r\n\r\n    <div *ngIf=\"!user.claimList.length\" class=\"h4 text-muted text-center p-4 border\">\r\n      Нет данных\r\n    </div>\r\n  </div>\r\n  <hr>\r\n  <div>\r\n    <h5>История банов:</h5>\r\n    <table class=\"table table-sm table-bordered table-dark mb-0\">\r\n      <thead>\r\n      <tr>\r\n        <th>ID Сообщения</th>\r\n        <th>Забанил</th>\r\n        <th>Причина</th>\r\n        <th>Истекает</th>\r\n      </tr>\r\n      </thead>\r\n      <tbody>\r\n      <tr *ngFor=\"let ban of user.ban\">\r\n        <td>\r\n          <app-icons [type]=\"'load-message'\" [data]=\"{messageId: ban.messageId, typeId: ban.typeId}\"></app-icons>\r\n        </td>\r\n        <td>\r\n          <div class=\"text-ellipsis\" [innerText]=\"ban.who\" title=\"{{ban.who}}\"></div>\r\n        </td>\r\n        <td>\r\n          <div class=\"text-ellipsis\" [innerText]=\"ban.reason\" title=\"{{ban.reason}}\"></div>\r\n        </td>\r\n        <td >\r\n          <div class=\"text-ellipsis\" [innerText]=\"ban.expired | date: 'dd/MM/yyyy h:mm:ss'\">\r\n\r\n          </div>\r\n        </td>\r\n      </tr>\r\n      </tbody>\r\n    </table>\r\n    <div class=\"h4 text-muted text-center p-4 border\" *ngIf=\"!user.ban.length\">\r\n      Нет данных\r\n    </div>\r\n  </div>\r\n  <div>\r\n    <app-thank-and-claim *ngIf=\"toggleThanks\" [type]=\"'thank'\" [to]=\"user.addr\" (updateCallback)=\"updateCallback()\"></app-thank-and-claim>\r\n    <hr>\r\n    <app-thank-and-claim *ngIf=\"toggleClaim\" [type]=\"'claim'\" [to]=\"user.addr\" (updateCallback)=\"updateCallback()\"></app-thank-and-claim>\r\n  </div>\r\n  <div class=\"text-right\">\r\n    <button class=\"btn btn-sm btn-outline-success mr-2\" (click)=\"toggleThanks = !toggleThanks\">Поощерить</button>\r\n    <button class=\"btn btn-sm btn-outline-warning mr-2\" (click)=\"toggleClaim = !toggleClaim\">Пожаловаться</button>\r\n    <button *ngIf=\"user.moder.isModer\" class=\"btn btn-sm btn-outline-danger\">Уволить</button>\r\n  </div>\r\n</div>\r\n"

